import React, { Component } from 'react';
import { Select } from 'antd';
//引入css文件
import './style.css';

const { Option } = Select;

export default class Content_fouth extends Component {

    //添加查看方式下拉框的数据
    mapRenderEventOption = () => {
        return this.props.values.map(item => {
            return (
                <Option name='indexValueId' key={item.id} value={item.attr}>{item.name}</Option>
            )
        })
    }

    onchange = (e) =>{
        console.log(e)
    }
    render() {
        return (
            <Select
                className='select_bottom'
                defaultValue='事件名'
            >
                {this.mapRenderEventOption()}
            </Select>
        )
    }
}
